import ModelData from './CatalogViewer.json';

function CatalogViewer(){
    return(
        <main>
            {ModelData.map(item =>(
                <>
                    <p>{item.id}</p>
                    <p>{item.user}</p>
                    <p>{item.price}</p>
                    <p>{item.rate}</p>
                    <p>{item.url}</p>
                </>
            ))}
        </main>
    );
}

export default CatalogViewer;
